const variableThemeSingle = {};

function getThemeVariables(options = { theme: 'sensGreen' }) {
  let themeVar = {
    'hack': `true;@import "${require.resolve('sensd/lib/style/color/colorPalette.less')}";`,
    ...defaultTheme
  };
  if(options.theme){
    themeVar = {
      ...themeVar,
      ...customThemeSingle[options.theme]
    }
  }
  if(options.dark) {
    themeVar = {
      ...themeVar,
      ...darkThemeSingle
    }
  }
  if(options.compact){
    themeVar = {
      ...themeVar,
      ...compactThemeSingle
    }
  }
  return themeVar;
}

module.exports = {
  darkThemeSingle,
  compactThemeSingle,
  getThemeVariables
}